import { useState } from "react";
import { useParams } from "react-router-dom";
import { Tabs, Tab } from "react-bootstrap";

function Detail(props) {
    let { id } = useParams();  // URL에서 id 값을 가져옴
    let 찾은상품 = props.MG.find(x => x.id == id);  // 해당 id의 상품을 찾음

    // 수량을 관리하는 상태
    let [quantity, setQuantity] = useState(1);

    // 수량 증가 함수
    const increaseQuantity = () => {
        setQuantity(quantity + 1);
    };

    // 수량 감소 함수 (1 미만으로는 줄지 않도록 설정)
    const decreaseQuantity = () => {
        if (quantity > 1) {
            setQuantity(quantity - 1);
        }
    };

    return (
        <div className="container detail-container">
            <div className="row">
                {/* 좌측 기본 이미지 영역 */}
                <div className="col-md-6">
                    <img src={process.env.PUBLIC_URL + `/images/mg${id}.jpg`} alt={찾은상품.gundam_name} width="100%" />
                </div>

                {/* 우측 상품 정보 영역 */}
                <div className="col-md-6">
                    <h2>{찾은상품.gundam_name}</h2>
                    <p>{찾은상품.price}</p>

                    {/* 가격과 주문 관련 정보 */}
                    <div className="product-info">
                        <p><strong>시리즈명: </strong>{찾은상품.gundam_series}</p>
                        <p><strong>수령 방법: </strong>택배 수령</p>
                    </div>

                    {/* 수량 선택 */}
                    <div className="quantity-selector">
                        <button onClick={decreaseQuantity} className="btn btn-outline-secondary">-</button>
                        <span className="quantity-box">{quantity}</span>
                        <button onClick={increaseQuantity} className="btn btn-outline-secondary">+</button>
                    </div>

                    {/* 총 가격 */}
                    <p><strong>총 상품금액: </strong>{parseInt(찾은상품.price.replace(/[^0-9]/g, '')) * quantity}원</p>

                    {/* 구매/장바구니/선물하기 버튼 */}
                    <div className="actions">
                        <button className="btn btn-danger">구매하기</button>
                        <button className="btn btn-outline-dark">장바구니</button>
                        <button className="btn btn-outline-dark">선물하기</button>
                    </div>
                </div>
            </div>

            {/* 탭 섹션 */}
            <div className="product-tabs mt-5">
                <Tabs defaultActiveKey="detail" id="product-tabs" className="mb-3">
                    <Tab eventKey="detail" title="상세보기">
                        <div>
                            {/* 상세 이미지 */}
                            {찾은상품.detail_images && 찾은상품.detail_images.length > 0 ? (
                                <img 
                                    src={process.env.PUBLIC_URL + 찾은상품.detail_images[0]} 
                                    alt="상세 이미지" 
                                    width="100%" 
                                    className="mb-3" 
                                />
                            ) : (
                                <p>상세 이미지가 없습니다.</p>
                            )}

                            {/* 설명 */}
                            <p>{찾은상품.description}</p>
                        </div>
                    </Tab>

                    <Tab eventKey="reviews" title="상품리뷰">
                        <div>
                            {/* 상품 리뷰 내용 */}
                            <h5>리뷰 1: 정말 멋진 프라모델입니다!</h5>
                            <p>강추합니다. 조립도 간단하고 디테일이 훌륭합니다.</p>

                            <h5>리뷰 2: 완성도 높은 제품입니다.</h5>
                            <p>시간이 좀 걸리지만 완성 후의 만족감이 최고입니다.</p>
                        </div>
                    </Tab>
                </Tabs>
            </div>
        </div>
    );
}

export default Detail;
